private void closeDocValues(final Collection<DocValues> values)
    throws IOException {
  IOException ex = null;
  for (DocValues docValues : values) {
    try {
      docValues.close();
    } catch (IOException e) {
      ex = e;
    }
  }
  if (ex != null) {
    throw ex;
  }
}

